import React, { useEffect } from 'react';

const Newspage = () => {
  useEffect(() => {
    console.log('Rendering News Page');
  }, []);  // Logs every time this component is rendered

  return (
    <div style={{ backgroundColor: 'lightblue' }}>
      <h1>Welcome to the News Page</h1>
    </div>
  );
};

export default Newspage;
